						sprintf(chEat, "Remain: %d", food3_num);
						hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_9);
						TEXT_SetText(hItem, chEat);
						
						hItem = WM_GetDialogItem(pMsg->hWin, ID_PROGBAR_0);
